import './App.css';
import Navbar from './components/navbar/navbar';
import Reminder from './components/reminder/reminder';

function fetchReminders() {
    return fetch('http://localhost:4000/reminders')
}

var reminders = fetchReminders().map((reminder, i) => {
    <Reminder reminderName={fetchReminders().keys()[i]} reminderDescription={reminder.message}/>
});

function App() {
  return (
    <div className="App">
        <Navbar />
        <ul id={"remindersWrapper"}>
            {reminders}
        </ul>
    </div>
  );
}

export default App;
